import './App.css';
import "leaflet/dist/leaflet.css";
import { Container, Row, Col, Table} from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';

function App() {
  return (
    <>

        <Container fluid="sm">
          <Row>
            <Col xs={12} md={8}>COVID-19 TRACKER</Col>
            <Col xs={12} md={4}>
              <Table>
                <tr>
                  <th>Country</th>
                  <th>Total Cases</th>
                </tr>
              </Table>
            </Col>
          </Row>
        </Container>
    </>
  );
}
export default App;
